import './App.css';

function App() {
  return (
    <div className="App">
      <svg viewBox="0 0 120 80" xmlns="http://www.w3.org/2000/svg" style={{backgroundColor: "red"}}>

        <text x="120" y="40" class="pixelFont">My</text>
      </svg>
    </div>
  );
}

export default App;
